import csvHIGHSCORE_FILE_NAME = "Player_Highscores.csv"def write_data(data: dict):    with open(HIGHSCORE_FILE_NAME, mode="w") as records:        fieldnames = ["Player Name", "Score", "Lines"]        writer = csv.DictWriter(records, fieldnames)        writer.writeheader()        writer.writerow(data)def read_data():    with open(HIGHSCORE_FILE_NAME, mode="r") as records:        print(records.readlines())write_data({"Player Name": "testname", "Score": 12345, "Lines": 10})read_data()